import React, { useState } from "react";
import "./styles/Pixel.css"

function Pixel() {
    const [color, setColor] = useState("#FFFFFF")


  return (
    <div 
        className="Pixel">
        style={{backgroundColor: color}}
        onClick={(event) => event.button === 0 ? setColor("#000000") : setColor("#FFFFFF")}
    </div>
  );
}

export default Pixel;
